import {
    GET_PSUS_STARTED,
    GET_PSUS_SUCCESS,
    GET_PSUS_ERROR
       } from "../actions/powersupplies";

       const defaultState = {
         psus: [],
         isLoading: false,
       };

       function psuReducer(state = defaultState, action) {
         switch (action.type) {
           case GET_PSUS_STARTED:
             return Object.assign({}, state, {
               isLoading: true,
             });
           case GET_PSUS_SUCCESS:
             return Object.assign({}, state, {
               isLoading: false,
               psus: action.payload.data,
             });
           case GET_PSUS_ERROR:
             return Object.assign({}, state, {
               isLoading: false,
               psus: [],
             });
           default:
             return state;
         }
       }

 export default psuReducer;
